import React from 'react'
import {Link} from 'react-router-dom';

function Header() {
    return (
        <div style={headerStyle}>
            <center>
            <h1>Todos</h1>
            <Link style={linkStyle} to="/">Home</Link>
            <Link style={linkStyle} to="/about">About</Link>
            </center>
        </div>
    )
}

const headerStyle = {
    backgroundColor:'black',
    width:'100vw',
    color:'white',
    margin:0
}

const linkStyle={
    color:'white',
    margin:'10px'
}
export default Header;
